import React, { Component } from 'react'

class Karsilama extends Component {
    render() {
        return (
            <div class="hero-image">
  <div class="hero-text">
    <h1 style="font-size:50px">I am John Doe</h1>
    <p>And I'm a Photographer</p>
    <button>Hire me</button>
  </div>
</div>
        )
    }
}
export default Karsilama;
